import { useState } from "react";
import styled from "styled-components";
import ReactDatePicker, { CalendarContainer } from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";
import { ko } from "date-fns/locale";

import Xbtn from "../Img/ph_x-bold.svg";
import Arrow from "../Img/ep_arrow-right-bold.svg";

// import axios from "axios";

const BackgroundBox = styled.div`
  width: 100%;
  height: 100%;
  top: 0;
  left: 0;
  background: transparent;
  position: fixed;
  z-index: 100;
  overflow: hidden;
`;

const Container = styled.div`
  width: 450px;
  max-height: 500px;
  height: auto;
  display: flex;
  flex-direction: column;
  justify-content: center;

  background: white;
  border-radius: 20px;
  z-index: 110;
  position: fixed;
  padding: 2rem;
  gap: 1rem;
  top: 0;
  bottom: 0;
  left: 0;
  right: 0;
  margin: auto;
  box-shadow: 5px 5px 5px 5px var(--line-gray);
`;

const ModalInputBox = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  flex-direction: column;
  align-items: center;
  gap: 3rem;
`;
const HeaderDiv = styled.div`
  width: 100%;
  height: 30px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: end;
  .Ximg {
    width: 25px;
    height: 25px;
  }
`;

const ModalInput = styled.input`
  width: 100%;
  height: auto;
  border-bottom: 1px solid var(--light-gray);
  padding: 10px;
  background: none;
`;

const ModalTime = styled.div`
  width: 100%;
  height: 100%;
  border-bottom: 1px solid var(--light-gray);
  padding: 10px;
  background: none;
`;

const TimeBlock = styled.div`
  width: 100%;
  height: 50%;
  background: var(--line-gray);
  display: flex;
  flex-direction: column;
  align-items: center;
  box-shadow: 5px 5px 5px 5px var(--line-gray);
  padding: 1rem;
  gap: 3rem;

  & div:has(div) {
    position: absolute;
    z-index: 200;
  }
`;

const StyledDatePicker = styled(ReactDatePicker)`
  width: 100%;
  height: 100%;
  text-align: center;
  background-color: transparent;

  & :hover {
    box-shadow: 5px 5px 5px 5px white;
  }
`;

const Customhead = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  justify-content: center;
  align-items: center;
  gap: 1rem;
  padding: 0;

  span {
    font-weight: 500;
  }
  margin: 5px 0;
`;

const DateBtn = styled.button`
  width: auto;
  height: auto;
  background: transparent;
  border-radius: 5px;
  padding: 1rem;
  &:hover {
    box-shadow: 5px 5px 5px 5px var(--line-gray);
  }
`;

const PrevButton = styled.div`
  style: none;
  cursor: pointer;
  width: 15px;
  height: 15px;
  background-image: url(${Arrow});
  background-size: cover;
`;

// 다음 달로 이동하는 버튼
const NextButton = styled(PrevButton)`
  transform: scaleX(-1);
`;

interface Prop {
  modal: boolean;
  setModal: React.Dispatch<React.SetStateAction<boolean>>;
}

export default function AddTodo(props: Prop) {
  const { modal, setModal } = props;
  const [pickDate, setPickDate] = useState<Date>(new Date());
  const [datepicker, setDatePicker] = useState<boolean>(false);
  // const timeArr = Array.from({ length: 24 }, (_, i) => i + 1);
  const handleDatePicker = (date: Date) => {
    setDatePicker(!pickDate);
    setPickDate(date);
  };
  return (
    <>
      <BackgroundBox onClick={() => setModal(!modal)}></BackgroundBox>
      <Container>
        <HeaderDiv>
          <button onClick={() => setModal(false)}>
            <img src={Xbtn} className="Ximg"></img>
          </button>
        </HeaderDiv>
        <ModalInputBox>
          <ModalInput placeholder="제목" />
          <ModalTime>
            <TimeBlock>
              <DateBtn onClick={() => setDatePicker(!datepicker)}>
                {`${pickDate.getFullYear()}년 ${pickDate.getMonth() + 1}월 ${pickDate.getDate()}일`}
              </DateBtn>
              <DateBtn onClick={() => setDatePicker(!datepicker)}>
                {`${pickDate.getFullYear()}년 ${pickDate.getMonth() + 1}월 ${pickDate.getDate()}일`}
              </DateBtn>
              {datepicker ? (
                <StyledDatePicker
                  locale={ko}
                  placeholderText="시작 날짜"
                  onChange={(date: Date) => handleDatePicker(date)}
                  inline
                  popperContainer={CalendarContainer}
                  renderCustomHeader={({
                    date,
                    decreaseMonth,
                    increaseMonth,
                  }) => (
                    <Customhead>
                      <PrevButton onClick={decreaseMonth}></PrevButton>
                      <span>
                        {`${date.getFullYear()}년 ${date.getMonth() + 1}월`}
                      </span>
                      <NextButton onClick={increaseMonth}></NextButton>
                    </Customhead>
                  )}
                />
              ) : null}
            </TimeBlock>
          </ModalTime>
        </ModalInputBox>
      </Container>
    </>
  );
}
